import useStyles from '../Styles/Header'

import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import { useState, useEffect } from 'react'
import { Typography } from '@material-ui/core';
import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles'


const Header = () => {

    const styles = useStyles()
    const theme = createMuiTheme({
        typography: {
            fontFamily: [
                'Inter',
            ].join(','),
            fontSize: 30,
        },

    })


    useEffect(() => {
        console.log(styles)
    })


    return (
        <ThemeProvider theme={theme}>
            <div>
                <Grid container spacing={3} className={styles.root} justify="center">
                    <Grid item xs={3}>
                        <div className={styles.item_first}><Typography>Back</Typography></div>
                    </Grid>
                    <Grid item xs={3}>
                        <div className={styles.main}><Typography>Dashboard</Typography></div>
                    </Grid>
                    <Grid item xs={3}>
                        <div className={styles.item_login}><Typography>Options</Typography></div>
                    </Grid>
                </Grid>
            </div>
        </ThemeProvider>
    )
}

export default Header
